import React from "react";
import './MainMenu.css';

function MainMenu() {
  return (
    <div className="App">
      <div className="Home-title">
        <h1>theAPP</h1>
      </div>
      <div className="Home-menu">
        <header className="App-header">
          <button className="mmButton">To-Do List</button>
          <br></br><br></br>
          <button className="mmButton">Daily Schedule Tracker</button>
        </header>
      </div>
    </div>
  );
}

export default MainMenu;
